import{o as r,c as n,b as p,u as a,i as t,a as o}from"./app.17d27ced.js";import{i as h}from"./chunks/vue-image-compare.d1bb251f.js";const d="data:image/jpeg;base64,",c="/upscale/assets/beautifullandscapeupsized.b752dd9b.jpg",u="/upscale/assets/beautifullandscapeupscaled.2ad9e7a9.jpg",m="/upscale/assets/chaiNNer.4b9b67d0.jpg",f="/upscale/assets/buddy.bef7ab62.jpg",g="/upscale/assets/SwinIR-L_GFPGANv1.4.1a424b7b.jpg",A=o('<h1 id="introduction" tabindex="-1">Introduction <a class="header-anchor" href="#introduction" aria-hidden="true">#</a></h1><h3 id="super-what" tabindex="-1">Super What? <a class="header-anchor" href="#super-what" aria-hidden="true">#</a></h3><p>Super Resolution. If we make a small image bigger (upsizing), it starts to look pixelated, simply because there is not enough information present in the small image. To prevent this, we use a method that imagines more details then there are in the original image, to make the image look better when upsizing. This is called upscaling, with the help of super resolution.</p><p>To keep things very simple, you can think of it as &quot;AI Image Enlarger&quot; and when you serach on the internet for it you will find lots of websites that will provide such a service. Now think of this website as a place where you can visually compare the results of hundreds of these websites. Just that its not websites we are comparing but individual models.</p><p>Let me show you an example of what super resolution does:<br> So we start with a small image I generated to depict a beautiful landscape:</p><p><img src="'+d+'" alt="Small"><br> Now we can display this image bigger, which is the same as upsizing: <img src="'+c+'" alt="Upsized"><br> But it looks very blurry now, does it not?<br> Now instead of upsizing, we make use of super resolution and upscale it: <img src="'+u+'" alt="Upscaled"><br> Now this looks better. But these details were not there before, they were artifically generated by the model we used to upscale.</p><h3 id="models" tabindex="-1">Models? <a class="header-anchor" href="#models" aria-hidden="true">#</a></h3><p>Since we cannot generate additional details in an image out of nothing, we make use of neural networks, which have been trained on a specific dataset, so it has the data to generate the additional details in the image we want to upscale.<br> These pretrained models is what I have been using on this website to upscale different examples for you. The models I used are listed in the Set Details in the multi models page or then at the very beginning of the page of a single upscaler like SwinIR.</p><p>A lot of pretrained models can be found on the <a href="https://upscale.wiki/wiki/Model_Database" target="_blank" rel="noreferrer">Upscale Wiki Model Database</a></p><h3 id="examples" tabindex="-1">Examples <a class="header-anchor" href="#examples" aria-hidden="true">#</a></h3><p>Since beauty is in the eye of the beholder, instead of me telling you whats I like and what not, I included examples on this web page for you to visually compare for yourself. You can find them in the sub pages on the left side. There is a multi model page where you can select between multiple different models and visually compare them with each other, and the other pages feature examples for one specific upscaling model to compare the original with the upscaled version.</p><p>For the comparisons I embedded on this page imgsli examples I had created. You can move the slider to compare, and you can even zoom into the image to better compare the details. The bottom right button enables fullscreen. The comparison works best on a large desktop/laptop screen rather than on a small mobile phone screen. Here is an example:</p>',12),b=o('<p>The images I use are either photos of mine or then images I had created with Midjourney (or Stable Diffusion).</p><p>Head over to the subpages to see more examples, most importantly to the <a href="./multimodels.html">multiple models page</a> or if you would like to compare only a small selection, you can head over to the <a href="./favorites.html">favorites page</a></p><h3 id="applications" tabindex="-1">Applications <a class="header-anchor" href="#applications" aria-hidden="true">#</a></h3><p>To uspscale these images I made use of <a href="https://github.com/chaiNNer-org/chaiNNer" target="_blank" rel="noreferrer">chaiNNer</a> which is an actively maintained application and the one I recommend. Others would be <a href="https://github.com/ptrsuder/IEU.Winforms" target="_blank" rel="noreferrer">IEU</a> or <a href="https://github.com/n00mkrad/cupscale" target="_blank" rel="noreferrer">Cupscale</a> but I have not used them myself.</p><p>Additionally I used websites like different spaces on <a href="https://huggingface.co/" target="_blank" rel="noreferrer">huggingface</a>, different models on <a href="https://replicate.com/" target="_blank" rel="noreferrer">replica</a> and colabs from google colab like this stable diffusion <a href="https://colab.research.google.com/github/TheLastBen/fast-stable-diffusion/blob/main/fast_stable_diffusion_AUTOMATIC1111.ipynb" target="_blank" rel="noreferrer">automatic1111 colab</a> or <a href="https://colab.research.google.com/github/TheLastBen/fast-stable-diffusion/blob/main/fast_stable_diffusion_hlky.ipynb" target="_blank" rel="noreferrer">HLKY</a>.</p><p>Here is a screenshot of using chaiNNer for a specific set on the multi models page:<br><img src="'+m+'" alt="chaiNNer"></p><h3 id="so-what-model-should-i-use" tabindex="-1">So what model should I use? <a class="header-anchor" href="#so-what-model-should-i-use" aria-hidden="true">#</a></h3><p>The one you personally like best. This page is meant for visual comparison of models not for me to recommend a specific one. But still, as a little help, for some of my favorites I have made specific subpages which only compare the original with the upscaled version. I mean any subpage besides this introduction page and the important multi models page.</p>',8),y=JSON.parse('{"title":"Introduction","description":"Introduction","frontmatter":{"title":"Introduction","description":"Introduction","layout":"doc"},"headers":[{"level":3,"title":"Super What?","slug":"super-what","link":"#super-what","children":[]},{"level":3,"title":"Models?","slug":"models","link":"#models","children":[]},{"level":3,"title":"Examples","slug":"examples","link":"#examples","children":[]},{"level":3,"title":"Applications","slug":"applications","link":"#applications","children":[]},{"level":3,"title":"So what model should I use?","slug":"so-what-model-should-i-use","link":"#so-what-model-should-i-use","children":[]}],"relativePath":"introduction.md"}'),w={name:"introduction.md"},S=Object.assign(w,{setup(T){const s=f,i=g,l={min:1,max:5};return(k,e)=>(r(),n("div",null,[A,p(a(h),{before:a(i),after:a(s),isDraggable:"",isZoomable:"",zoom:l,onWheel:e[0]||(e[0]=t(()=>{},["prevent"])),onTouchmove:e[1]||(e[1]=t(()=>{},["prevent"])),onScroll:e[2]||(e[2]=t(()=>{},["prevent"]))},null,8,["before","after"]),b]))}});export{y as __pageData,S as default};
